  <title>Ошибка сервера | TextBack</title>

  <style>
    html {
      font-family: 'IBM Plex Sans', sans-serif;
      overflow-x: hidden;
      overflow-y: auto;
    }
    body {
      min-height: 100vh;
      margin: 0;
    }

    a {
    text-decoration: none; 
    }
    .server-error {
      display: flex;
      flex-direction: column;
      padding: 30px 0 0 30px;
    }

    .server-error__brand-logo-container {
      margin-bottom: 49px;
    }

    .server-error__brand-logo-container > a > img {
      width: 122px;
      height: 40px;
    }

    .server-error__container {
      display: flex;
      flex-direction: column;
      justify-items: center;
    }

    .server-error__content {
      display: flex;
      flex-direction: row;
      justify-content: center;
    }

    .server-error__content-text {
      display: flex;
      flex-direction: column;
      justify-content: center;
      width: 327px;
      align-self: flex-end;
      margin-bottom: 25px;
    }

   

    .server-error__content_image {
      margin-left: 151px;
      width: 892px;
    }

    .server-error__content_button {
      display: flex;
      flex-direction: row;
      flex-wrap: nowrap;
    }

    .server-error__text_oops {
      margin-bottom: 44px;
    }

    .server-error__text_description {
      font-style: normal;
      font-weight: 600;
      font-size: 32px;
      line-height: 42px;
      color: #34466c;
      margin-bottom: 20px;
    }

    .server-error__text_description-text {
      font-style: normal;
      font-weight: normal;
      font-size: 15px;
      line-height: 150%;
      color: #34466c;
    }

    .server-error__telegram-button-wrapper {
      align-self: flex-end;
    }

    .server-error__telegram-button {
      display: flex;
      align-items: center;
      padding: 10px 40px;
      font-style: normal;
      font-weight: 600;
      font-size: 18px;
      line-height: 23px;
      color: #fff;
      background: #25A5E4;
      border: none;
      border-radius: 4px;
      cursor: pointer;
    }

    .server-error__telegram-button > span {
      margin-right: 15px;
    }

    .server-error__telegram-button > i {
      font-size: 28px;
      font-weight: 400;
    }

  </style>
